import React from "react";

const Projectsuperdiversity = () => {
    return (
        <div>
            <div className="project-link"><a href="http://www.superdiv.mmg.mpg.de/">View Project</a></div>
            <h2>About this project</h2>
            <div className="project-details">
                <p>I had the opportunity to build a React project for Stamen Design, in their collaboration with Max
                    Planck Institute to visualize data collected on diversity.</p>
            </div>
        </div>
    );
};

export default Projectsuperdiversity;
